vs/workbench/contrib/terminal/common/ter.terminal.integrated.commandsToSkipShell:
Набір ідентифікаторів команд, настроювані комбінації клавіш яких не будуть передаватися в оболонку, а натомість завжди оброблятимуться VS Code. Це дозволяє використовувати настроювані комбінації клавіш, які за звичайних умов були б використані оболонкою і працювали б так само, як якщо б термінал не мав фокусу, наприклад, клавіші "CTRL+P" запускали б Quick Open.

&nbsp;

Багато команд за замовчуванням пропускаються. Щоб перевизначити значення за замовчуванням і передати настроювану комбінацію клавіш цієї команди в оболонку, додайте команду з префіксом "-". Наприклад, додайте "-workbench.action.quickOpen", щоб комбінація клавіш "CTRL+P" була направлена в оболонку.

&nbsp;

Наступний список команд, що пропускаються за замовчуванням, обрізається при перегляді в Редакторі параметрів. Щоб переглянути повний список, {1} і виконайте пошук першої команди зі списку нижче.

